/**
 * 
 * @param {*} prop 
 */
import React from "react";
import Home from "./homeActive.png"


function Footer(prop) {
    return( <footer>
           <table className="fullPage">
           <tr>
              <td><a className="fullPage" href="./2/login">Login</a></td>
              <td><img className="icon" src={Home} alt=""/></td>
              <td><a className="right" href="./create">Create Account</a></td>
          </tr>
          </table>
          </footer> );

}

export default Footer;
